"   </div>",
"   <div class=\"cntnt\" style=\"width: 297px; height: 574px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The variability in the histologic appearance of prostate cancer following radiation therapy is illustrated by these high power photomicrographs of two hematoxylin and eosin stained tissue sections from the same patient. Top panel: this area of the biopsy is characterized by marked histologic change, with the tumor cells demonstrating significant degenerative changes and atrophy. The cytologic atypia can hardly even be recognized (arrowheads). Bottom panel: in contrast, tumor cells from a different area of the same specimen from the same irradiated patient shown in the above panel demonstrates the characteristic cytologic atypia of prostate cancer (arrows) without significant atrophic changes.",
