var title_f41_21_42331="Causes of gynecomastia";
var content_f41_21_42331=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F53468&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F53468&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Conditions associated with gynecomastia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physiologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neonatal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pubertal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Involutional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Pathologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiopathic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cirrhosis or malnutrition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Male hypogonadism - primary or secondary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Neoplasms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Testicular - germ cell, Leydig",
"cell, Sertoli cell, sex cord",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Adrenal - adenoma or carcinoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Ectopic production of human",
"chorionic gonadotropin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperthyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal disease and dialysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Rare causes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Enzymatic defects of testosterone production*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Androgen-insensitivity syndromes*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        True hermaphroditism*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Excessive extraglandular aromatase activity",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * These conditions are usually associated with ambiguity of genitalia or deficient virilization.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Braunstein, GD, N Engl J Med 1993; 328:490.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
